import React from 'react';
import ReactDOM from 'react-dom';
import Button from 'react-bootstrap/Button';
import './Botton.css';
function button(props) {
  return (

    <Button className="btn-flat" onClick={this.props.onClick} label={props.val}>hi
    </Button>
  );
}
class Buttons extends React.Component {
  renderButton(i,val) {
    return (
      <button
        val={val}
        onClick={() => this.props.onClick(i)}
      />
    );
  }

  render() {
    return (
    <div>
      <div>
      {this.renderButton(0,this.props.buttons[0])}
      </div>
       <div>
      {this.renderButton(1,this.props.buttons[1])}
      </div>
       <div>
      {this.renderButton(2,this.props.buttons[2])}
      </div>
       <div>
      {this.renderButton(3,this.props.buttons[3])}
      </div>
      </div>
    );
  }
}
export default Buttons;
